///CONTENT INCLUDED///
-- The latest version of the emulator itself

-- The North American BIOS File &quot;scph1001.bin&quot;

-- GPU,SPU,CDR Plugins

-- PSX Cheater Program

-- epsxecutor w/configs

-- shader files




///INSTRUCTIONS//
-- unzip &quot;epsxe_pack-zoofie.zip&quot;

-- run &quot;epsxe_pack.exe&quot;
     the result will be a directory &quot;emulation&quot; with PSXepsxe inside

-- run &quot;epsxe.exe&quot; and configure it to your needs and play!



Thanks for downloading! Please seed to help others!
